// Tree traversal function
// IMPORTANT: Match XGBoost's exact behavior
// - Use <= for comparison (like v2 export_v2_to_cpp.py line 221)
// - XGBoost uses float32 internally for comparisons, so cast to float for exact match
inline double traverse(const TreeNode* t, const double* x) {
    int n = 0;
    while (t[n].feature >= 0) {
        int feat_idx = t[n].feature;
        if (feat_idx >= 0 && feat_idx < N_NORM_FEATURES) {
            // Cast to float for comparison to match XGBoost's internal float32 behavior
            // XGBoost uses < (not <=) for split condition: if feature < threshold, go left
            float feat_val = static_cast<float>(x[feat_idx]);
            float threshold = static_cast<float>(t[n].threshold);
            if (feat_val < threshold) {
                n = t[n].left;
            } else {
                n = t[n].right;
            }
        } else {
            // Invalid feature index - go to left child
            n = t[n].left;
        }
    }
    return t[n].value;
}

// Prediction function
inline double predict(const double* features) {
    // Normalize features if needed
    // Handle NaN correctly: NaN - number = NaN, NaN / number = NaN (preserves NaN)
    double normalized[N_NORM_FEATURES];
    for (int i = 0; i < N_NORM_FEATURES; ++i) {
        if (std::isnan(features[i])) {
            normalized[i] = std::numeric_limits<double>::quiet_NaN();
        } else {
            normalized[i] = (features[i] - COL_MEANS[i]) / COL_STDS[i];
        }
    }
    
    // Traverse all trees
    double sum = BASE_SCORE;
    for (int i = 0; i < N_TREES; ++i) {
        sum += traverse(TREES[i], normalized);
    }
    
    // Denormalize target
    return sum * TARGET_SCALE + TARGET_MEAN;
}

